import React from 'react';
import Header from './header';
import Main from './Main';
import Footer from './footer';
import {BrowserRouter} from 'react-router-dom';
import Routing from '../Routing';

class App extends React.Component {
  render() {
    return(
      <BrowserRouter>
        <Header />
        <Routing></Routing>
        <Footer />
      </BrowserRouter>
    );
  }
}

export default App;
